import React from "react";

import ReactDOM from 'react-dom';

import { Row, Col, Container } from 'react-bootstrap';

import { SocialIcon } from 'react-social-icons';

import StickyFooter from 'react-sticky-footer';

const Footer = () => {
  return (
<Container>
    <StickyFooter
    bottomThreshold={50}
    normalStyles={{
    backgroundColor: "#999999",
    padding: "2rem"
    }}
    stickyStyles={{
    backgroundColor: "transparent",
    padding: "2rem",
    display: "block"
    }}
    >
        <Row>
            <Col md={4}>
    <h3>Cell: 843-271-3434</h3>
            </Col>
            <Col md={4}>
    <h3>Email: walkerkeatley@yahoo.com</h3>
            </Col>
    <SocialIcon url="https://twitter.com/blackfalcon_unc" />
    <SocialIcon url="https://www.instagram.com/floyds_fotos/" />
    <SocialIcon url="https://github.com/walkerfloyd1" />
    <SocialIcon url="https://www.linkedin.com/in/walker-floyd-b53182123/" />
        </Row>
</StickyFooter>
</Container>
  );
}

export default Footer;
